import { Formik, Form, Field, ErrorMessage } from "formik"
import axios from "axios"
import * as yup from "yup"
import { useNavigate, Link } from "react-router-dom"
import { useEffect, useState } from "react"




function ShopperRegisterComponent() {

    const navigate = useNavigate()
    const [users, setUsers] = useState([]);
    const [userError, setUserError] = useState("");


    useEffect(() => {
        axios({
            method: "get",
            url: "http://127.0.0.1:8081/users"
        })
            .then(res => {
                setUsers(res.data);
            })
    }, []);

    function VerifyUserID(e) {
        //    alert( e.target.value)
        for (var user of users)
            if (user.UserID === e.target.value) {
                setUserError("User Name is already taken - try another")
                break;
            } else {
                setUserError("User Name is available")
            }
    }

    return (
        <div className="container-fluid">
            <h3>Register User</h3>
            <Formik
                initialValues={{
                    UserID: "",
                    UserName: "",
                    Password: "",
                    Email: "",
                    Age: null,
                    Mobile: ""
                }}
                validationSchema={
                    yup.object({
                        UserID: yup
                            .string()
                            .required("UserID is Required"),
                        UserName: yup
                            .string()
                            .required("UserName is Required"),
                        Password: yup
                            .string()
                            .required("Password is Required"),
                        // .matches(/(?=.*[A-Z])\w{5,10}/, "Must Contain 1 Upper Case Letter & should be 6-10 characters"),
                        Email: yup
                            .string()
                            .email("Invalid Email")
                            .required("Email is Required"),
                        Age: yup
                            .number()
                            .min(1)
                            .max(99)
                            .required("Age is Required"),
                        Mobile: yup
                            .string()
                            .required(" Mobile number Required")
                            .matches(/\d{10}/, "Invalid Mobile Number")
                    })
                }
                onSubmit={
                    (values) => {
                        axios({
                            method: "post",
                            url: "http://127.0.0.1:8081/registeruser",
                            data: values
                        })
                            .then(() => {
                                alert("Registered Successfully..")
                                navigate("/login")

                            })
                    }}
            >
                {
                    <Form className="form-control w-25">
                        <dl >

                            <dt><label htmlFor="UserID">User Id</label></dt>
                            <dd><Field type="text" onKeyUp={VerifyUserID} id="UserID" name="UserID" /></dd>
                            <dd className="text-danger">
                                <ErrorMessage name="UserID" />
                            </dd>
                            <dd className="text-success">{userError}</dd>

                            <dt><label htmlFor="UserName">User Name</label></dt>
                            <dd><Field type="text" id="UserName" name="UserName" /></dd>
                            <dd className="text-danger">
                                <ErrorMessage name="UserName" />
                            </dd>

                            <dt><label htmlFor="Password">Password</label></dt>
                            <dd><Field type="password" id="Password" name="Password" /></dd>
                            <dd className="text-danger">
                                <ErrorMessage name="Password" />
                            </dd>

                            <dt><label htmlFor="Email">Email</label></dt>
                            <dd><Field type="email" id="Email" name="Email" /></dd>
                            <dd className="text-danger">
                                <ErrorMessage name="Email" />
                            </dd>

                            <dt><label htmlFor="Age">Age</label></dt>
                            <dd><Field type="text" id="Age" name="Age" /></dd>
                            <dd className="text-danger">
                                <ErrorMessage name="Age" />
                            </dd>

                            <dt><label htmlFor="Mobile">Mobile</label></dt>
                            <dd><Field type="text" id="Mobile" name="Mobile" /></dd>
                            <dd className="text-danger">
                                <ErrorMessage name="Mobile" />
                            </dd>


                        </dl>
                        <button className="btn btn-success" type="submit">Register</button>
                            <Link className="btn ms-2 btn-primary" to="/login">Log In</Link>
                        
                    </Form>
                }
            </Formik>

        </div>
    )
}
export default ShopperRegisterComponent
